import React, {Component} from 'react'
import './style/dashboard.css'
export default class Dashboard extends Component{

    constructor(props){
        super(props)
        this.state = {
            username: ''
        }
    }
    
    render(){
        return(
            <div className="textbox">
            <h1>
                Welcome, puttipong
            </h1>
            </div>
            
        )
    }
}
